    true,nt"url": null,nt"notes": "<p>The Medicaid Analytic eXtract (MAX) data
    is a set of person-level data files on Medicaid eligibility, service utilization,
    and payments. The MAX data are created to support research and policy analysis.
    The MAX data are extracted from the Medicaid Statistical Information System (MSIS).
    The MAX development process combines MSIS initial claims, interim claims, voids,
    and adjustments for a given service into final action events.</p>n",nt"license_title":
